import React from 'react';
import styled from 'styled-components';

const Section=styled.section``;
const Container=styled.div``;
const InfoSec = () => {
    return (
       <Section>
           <Container>
               <coloumnLeft>
               <h1></h1>
               <p></p>
               </coloumnLeft>
               <coloumnRight>
               <img src='' alt='home'></img>
               </coloumnRight>
           </Container>
       </Section>
    )
}

export default InfoSec
